                'leucocitos_resultado' => $dato[16] === '' ? null : $dato[16],
                'leucocitos_unidades' => $dato[17],
                'leucocitos_referencia' => $dato[18],
                'plaquetas_resultado' => $dato[19] === '' ? null : $dato[19],
                'plaquetas_unidades' => $dato[20],
                'plaquetas_referencia' => $dato[21],
                'zona' => $dato[22],
            ]);
        }
        $zonas = DatosUser::select('area')->groupBy('area')->get();
        // info($zonas);
        $zonas->map(function($zona){
            $rpeLista = Datosuser::where('area', $zona)
                ->pluck('rpe');
            ProSalud::whereIn('rpe', $rpeLista)
                ->update(['zona' => $zona]);
        });
    }
}
